export { html } from 'htm/preact';

export * from 'preact';
export {
  useState,
  useRef,
  useCallback,
  useContext,
  useEffect,
  useDebugValue,
  useErrorBoundary,
  useLayoutEffect,
  useId,
  useMemo,
  useReducer,
  useImperativeHandle
} from 'preact/hooks';
